/* He creado un array con 3 imágenes y, valiéndome de la funciones que he encontrado en internet  (getRandomInt) he querido que cada vez que se pulse el botón aparezca una imagen random de mi sobrino*/
  
images = [img1, img2, img3];

document.getElementById('avatar').src = images[0];



function updateImage() {
    console.log(document.getElementById('name').value);
    random = getRandomInt(images.length);
    document.getElementById("avatar").src = images[random];
    
}


function getRandomInt(max) {
    return Math.floor(Math.random() * max);
  }